import React, {Component} from 'react';
import {BrowserRouter as Router, Route,Link, Redirect } from 'react-router-dom'
import Navbar from './vendornavbar.js';
import Create from './create-product.js';
import View from './view-product.js';
import Ready from './rtodis-product.js';
import Dispatched from './dis-product.js';

export default class Vendor extends Component {
	constructor(props){
		super(props);
		console.log(props);
		this.state={
			id:this.props.match.params.id
		}
	}
	render(){
		// console.log(this.state.id);
		return (
			<Router>
				<div>
				<nav style={{ lineWidth:"1500px"}}>
				<div style={{ display: "flex",flexDirection: "row",justifyContent: "space-between", alignItems: "center",flexWrap: "Wrap" }}>
					<div className="nav-wrapper white" style={{ width: "25%"}}>
						<Link
							to={"/vendor/"+this.state.id+"/create"}
							style={{fontFamily: "monospace",fontSize:"20px"}}
							className="col s5 brand-logo center black-text"
						>
							Create
						</Link>
					</div>
					<div className="nav-wrapper white" style={{ width: "25%"}}>
						<Link
							to={"/vendor/"+this.state.id+"/view"}
							style={{fontFamily: "monospace",fontSize:"20px"}}
							className="col s5 brand-logo center black-text"
						>
							View
						</Link>
					</div>
					<div className="nav-wrapper white" style={{ width: "25%"}}>
						<Link
							to={"/vendor/"+this.state.id+"/ready"}
							style={{fontFamily: "monospace",fontSize:"20px"}}
							className="col s5 brand-logo center black-text"
						>
							Ready
						</Link>
					</div>
					<div className="nav-wrapper white" style={{ width: "25%"}}>
						<Link
							to={"/vendor/"+this.state.id+"/dispatched"}
							style={{fontFamily: "monospace",fontSize:"20px"}}
							className="col s5 brand-logo center black-text"
						>
							Dispatched
						</Link>
					</div>
				</div>
			</nav>
			</div>
		  <Route exact path="/vendor/:id/create" component={Create}/>
          <Route exact path="/vendor/:id/view" component={View}/>
          <Route exact path="/vendor/:id/ready" component={Ready}/>
          <Route exact path="/vendor/:id/dispatched" component={Dispatched}/>
			</Router>
		);
	}
}
